import React from 'react';
import ReactDOM from 'react-dom/client';

  
const Ads = () => {
    return ( 
        <div>
            <label for=''>Car</label>
            <input type='text' id='id'/>
        </div>
     );
}

 
const Xdcalamviec = () => {

    const root2 = ReactDOM.createRoot(document.getElementById('root2'));

        root2.render(
            <Ads/>
    )
}



export default Xdcalamviec;
